import React from "react";
import { Layout } from "./components";
import { Login } from "./pages";

function App() {
	const [isAuth, setisAuth] = useState(false);
	return (
		<div className="w-full min-h-[100vh%]">
			{isAuth ? <Layout /> : <Login setisAuth={setisAuth} />}
		</div>
	);
}

export default App;
